      out.write("                week : 'week',\r\n");
      out.write("                day  : 'day'\r\n");
      out.write("            },\r\n");
      out.write("            //Random default events\r\n");
      out.write("            events    : [\r\n");
      out.write("                {\r\n");
      out.write("                    title          : 'All Day Event',\r\n");
      out.write("                    start          : new Date(y, m, 1),\r\n");
      out.write("                    backgroundColor: '#f56954', //red\r\n");
      out.write("                    borderColor    : '#f56954' //red\r\n");
      out.write("                },\r\n");
      out.write("                {\r\n");
      out.write("                    title          : 'Long Event',\r\n");
      out.write("                    start          : new Date(y, m, d - 5),\r\n");
      out.write("                    end            : new Date(y, m, d - 2),\r\n");
      out.write("                    backgroundColor: '#f39c12', //yellow\r\n");
      out.write("                    borderColor    : '#f39c12' //yellow\r\n");
      out.write("                },\r\n");
      out.write("                {\r\n");
      out.write("                    title          : 'Meeting',\r\n");
      out.write("                    start          : new Date(y, m, d, 10, 30),\r\n");
      out.write("                    allDay         : false,\r\n");
      out.write("                    backgroundColor: '#0073b7', //Blue\r\n");
      out.write("                    borderColor    : '#0073b7' //Blue\r\n");
      out.write("                },\r\n");
      out.write("                {\r\n");
      out.write("                    title          : 'Lunch',\r\n");
      out.write("                    start          : new Date(y, m, d, 12, 0),\r\n");
      out.write("                    end            : new Date(y, m, d, 14, 0),\r\n");
      out.write("                    allDay         : false,\r\n");
      out.write("                    backgroundColor: '#00c0ef', //Info (aqua)\r\n");
      out.write("                    borderColor    : '#00c0ef' //Info (aqua)\r\n");
      out.write("                },\r\n");
      out.write("                {\r\n");
      out.write("                    title          : 'Birthday Party',\r\n");
      out.write("                    start          : new Date(y, m, d + 1, 19, 0),\r\n");
      out.write("                    end            : new Date(y, m, d + 1, 22, 30),\r\n");
      out.write("                    allDay         : false,\r\n");
      out.write("                    backgroundColor: '#00a65a', //Success (green)\r\n");
      out.write("                    borderColor    : '#00a65a' //Success (green)\r\n");
      out.write("                },\r\n");
      out.write("                {\r\n");
      out.write("                    title          : 'Click for Google',\r\n");
      out.write("                    start          : new Date(y, m, 28),\r\n");
